import React, { useState } from "react";
import { CleanButtonWithAnimation } from "../../Styled_Components/Buttons";
import { FilterButtonLine } from "../../Styled_Components/filterButtonLine";
import "./RestaurantProfilePages.css";
const demoImg =
  "https://img.delicious.com.au/Ry81lFCS/w1200/del/2017/08/braised-chicken-rosemary-and-chilli-pasta-50928-2.jpg";
const demoFoodImg =
  "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSj9LB5LddQtJaOcSTPcyxsbc2KwcwDYqwpaQ&usqp=CAU";
const RestaurantProfilePages = () => {
  const [currentTab, setCurrentTab] = useState<string>("Breakfast");
  const changTab = (value: string) => {
    setCurrentTab(value);
  };
  const isOpen: boolean = true;
  return (
    <div className="RestaurantProfilePages">
      <img className="restaurantPic" src={demoImg} alt="food" />
      <h3>Claro</h3>
      <span>Ran Shmueli</span>
      <div className="restaurantOpenStatus">
        {isOpen ? (
          <>
            <img src="\imges\icons\clock-icon.svg" alt="clock" />
            <span>Open now</span>
          </>
        ) : (
          <>
            <span>Open between</span>
            <span>10:00 - 22:00</span>
          </>
        )}
      </div>
      <FilterButtonLine style={{ fontSize: "24px" }}>
        <CleanButtonWithAnimation
          name="Breakfast"
          onClick={(value) => {
            console.log();
            value.currentTarget.innerText;
          }}
          className={currentTab === "Breakfast" ? "fixHover" : ""}
        >
          Breakfast
        </CleanButtonWithAnimation>
        <CleanButtonWithAnimation
          className={currentTab === "Launch" ? "fixHover" : ""}
        >
          Launch
        </CleanButtonWithAnimation>
        <CleanButtonWithAnimation
          className={currentTab === "Dinner" ? "fixHover" : ""}
        >
          Dinner
        </CleanButtonWithAnimation>
      </FilterButtonLine>
    </div>
  );
};
export default RestaurantProfilePages;
